import './App.css';
import Profile from './components/Login/Profile/Profile';
import LoginButton from './components/Login/Login';
import { LogoutButton } from './components/Logout';

function App() {
  const { isAuthenticated } = useAuth0();
  return (
    <div className="App">
      {isAuthenticated ? <>
        <Profile/>
        <LogoutButton />
      </>
    : <LoginButton />}
    </div>
  );
}
